import React, { useState } from "react";

function Square() {

  const[value, setValue] = useState(null);

  function handleClick()  {
    setValue('X')
  }
  return (
    <button 
      className="square"
      onClick={handleClick}
    >
      {value}
    </button>)
}

export default function Board() {

  const [square, setSquar] = useState(Array(9).fill(null))

  return (
  <>
    {/* button is a JSX element */}
    <div className="board-row">
      <Square />
      <Square />
      <Square />
    </div>
    <div className="board-row">
      <Square />
      <Square />
      <Square />
    </div>
    <div className="board-row">
     <Square />
      <Square />
      <Square />
    </div>
  </>
  );
}
